import React from 'react';

const Followers = ({ followerList }) => {
    return (
      <div>
        <h3>Followers</h3>
        <ul>
          {followerList.map(follower => (
            <li key={follower.id}>{follower.name}</li>
          ))}
        </ul>
      </div>
    );
  };

  export default Followers;
